	(500, '712376759-4', 'novel', 'Runaways, The', 'Shelagh', 'Twitterlist', 849, 17659, 'default.jpg', NULL, '2020-03-01 00:00:00', '구편절판'),
	(503, '118886229-4', 'novel', '지구에서 한아뿐', '정세랑', '난다', 228, 13000, '31.jpg', '창비장편소설상, 한국일보문학상 수상 작가 정세랑의 두번째 장편소설. 칫솔에 근사할 정도로 적당량\r\n의 치약을 묻혀 건네는 모습에 감동하는 한아는 저탄소생활을 몸소 실천하는 의류 리폼 디자이너다. 그\r\n녀는 \'환생\'이라는 작은 옷 수선집을 운영하며 누군가의 이야기와 시간이 담긴 옷에 작은 새로움을 더해\r\n주곤 한다.<br><br>\r\n한아에게는 스무 살 때부터 좋아한, 만난 지 11년 된 남자친구 경민이 있다. 늘 익숙한 곳에 머무려 하는 \r\n한아와 달리 자유분방하게 살아가는 경민은 이번 여름에도 혼자 유성우를 보러 캐나다로 훌쩍 떠나버\r\n린다. 자신의 사정을 고려해주지 않는 경민이 늘 서운했지만 체념이라고 부르는 애정도 있는 것이라 생\r\n각하는 한아. <br><br>\r\n때마침 캐나다에 운석이 떨어져 소동이 벌어졌다는 뉴스에 한아는 걱정이다. 경민은 무사히 돌아왔지\r\n만 어딘지 미묘하게 낯설어졌다. 팔에 있던 커다란 흉터가 사라졌는가 하면 그렇게나 싫어하던 가지무\r\n침도 맛있게 먹는다. 그리고 무엇보다도 한아를 늘 기다리게 했던 그였는데 이제는 매순간 한아에게 집\r\n중하며 "조금 더 함께 있는" 듯한 기분을 준다. 달라진 경민의 모습과 수상한 행동이 의심스러운 한아는 \r\n무언가가 잘못되어간다고 혼란에 빠지는데…….<br>\r\n<iframe width="100%" height="300" src="https://www.youtube.com/embed/-6Y9URw7ek4" \r\ntitle="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; \r\nencrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', '2021-03-26 11:26:58', '판매중'),
	(512, '119009026-0', 'novel', '천개의 파랑', '천선란', '퍼블', 376, 14000, '0.jpeg', '한국과학문학상 장편 대상 수상작. 2019년 첫 장편소설 <무너진 다리>로 SF 팬들에게 눈도장을 찍었\r\n고, 2020년 7월, 소설집 <어떤 물질의 사랑>을 통해 우리 SF의 대세로 굳건히 자리 잡은 천선란. 2019\r\n년 한국과학문학상 장편 대상 수상작 <천 개의 파랑>은 이를 방증하듯 출간 전부터 많은 SF 팬들의 뜨\r\n거운 기대를 모았다.<br><br>\r\n\r\n<천 개의 파랑>은 한국과학문학상 심사위원 김보영에게 “천 개의 파랑이 가득한 듯한 환상적이고 우아\r\n한 소설”, “이미 활발하게 활동하고 있는 유명 작가의 작품이라 해도 믿을 법했다” 라는 찬사를 이끌어\r\n냈다. 이는 김창규 작가가 한국과학문학상 심사평에서 언급한 말과 맥을 같이 한다. “더 이상 좋은 한국 \r\nSF의 가능성’이란 얘기는 듣지 않아도 되겠다는 생각이 들어 기뻤다. 그만큼 SF를 충분히 소화하고 빚\r\n은 작품들이, 가능성을 넘어 다양한 길을 정하고 완성되고 있었다.” 천선란은 더 이상 SF의 가능성이 아\r\n니다. 그는 이미 완숙하게 무르익은 상태로 우리에게 도달한 ‘준비된 작가’다.<br><br>\r\n\r\nSF가 진보하는 기술 속에서 변화하고 발전하는 모습을 예견하는 장르라면, <천 개의 파랑>은 진보하는 \r\n기술 속에서 희미해지는 존재들을 올곧게 응시하는 소설이다. 발달한 기술이 배제하고 지나쳐버리는 \r\n이들, 엉망진창인 자본 시스템에서 소외된 이들, 부서지고 상처 입은 채 수면 아래로 가라앉아 있던 이\r\n들을 천선란은 다정함과 우아함으로 엮은 문장의 그물로 가볍게 건져 올린다. 그의 소설은 희미해진 이\r\n들에게 선명한 색을 덧입히는 과정으로 이루어져 있다.<br>', '2021-04-07 14:43:49', '판매중'),
	(515, '116521014-2', 'economic', '주식투자 무작정 따라하기', '윤재수', '길벗', 420, 18000, '1.jpeg', '『주식투자 무작정 따라하기』의 5차 개정판에는 지금 당장 시장 분석에 활용할 수 있도록 업데이트된 시장분석자료와 기업데이터는 물론 스마트폰의 대중적 보급에 따른 모바일 환경에서의 투자 조언, 달라진 주식시장 제도, 해외주식투자자를 위한 친절한 조언 등을 꼼꼼하게 담았다. 투자의 기본 원칙은 잃지 않는 것이다. 이 책은 안전하면서도 확실하게 수익 내는 주식투자의 기본 원칙을 충실하게 담고 있다. 40년 넘게 주식시장을 지켜온 정통 전문가인 저자가 폭넓은 안목과 시장에 대한 깊이 있는 판단, 올바른 투자에 대한 현실적인 조언을 담아냈다. 또한 왕초보는 물론 중급자로 발돋움하려는 투자자를 위해 급변하는 시장환경에 따라 등락을 거듭하는 주식시장에서 HTS를 이용해 제대로 된 종목과 매매시점을 선정하는 법과 주식시장의 변화를 이해하기 위한 경제 흐름 읽는 법까지 알려준다.', '2021-04-07 15:10:18', '판매중'),
	(516, '116413645-3', 'social', '공정하다는 착각', '마이클샌델', '와이즈베리', 420, 18000, '800.jpeg', '마이클 샌델 10여 년 만의 신간, 『공정하다는 착각』 출간!<br>\r\n샌델, 기울어진 사회구조 이면에 도사린 ‘능력주의의 덫’을 해체하다<br><br>\r\n\r\n또 다시 ‘공정’이 화두다. 언론 미디어를 통해, 부유층과 빈곤층, 청년과 장년, 정치인의 입을 통해 끊임없이 쏟아져 나온다. 기업은 정규직?비정규직 논란에서 비롯된 ‘공정 채용’ 문제로 혼란에 빠져 있고, 정치권에선 ‘공정경제3법’과 ‘재난지원금’ 등에 대한 각기 다른 해석으로 떠들썩하다. 대통령은 “하나의 공정이 또 다른 불공정을 부르는 상황”을 언급하며 어려움을 토로하기도 했다. 이렇듯 ‘공정’이라는 하나의 화두를 두고 각계각층이 충돌하고 있는 상황에서, 마이클 샌델 하버드대 교수가 『돈으로 살 수 없는 것들』 이후 8년 만에 쓴 신간 『공정하다는 착각』이 출간되었다.<br><br>\r\n\r\n이 책은 『The Tyranny of Merit: What’s Become of the Common Good?』란 원제로 미국 현지에서 2020년 9월에 출간되어 뜨거운 반응을 얻고 있다. 직역하면 ‘능력주의의 폭정: 과연 무엇이 공동선을 만드나?’다. 샌델은 이 책을 통해 “우리가 ‘노력하면 성공할 수 있다’고 너무나도 당연히 생각해왔던, 개인의 능력을 우선시하고 보상해주는 능력주의 이상이 근본적으로 크게 잘못되어 있다”고 주장한다. 이러한 능력주의가 제대로 공정하게 작동하고 있는지, ‘공정함=정의’란 공식은 정말 맞는 건지 진지하게 되짚어본다.<br><br>\r\n<iframe width="100%" height="450" src="https://www.youtube.com/embed/XjltVncQRQQ" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', '2021-04-07 17:15:04', '판매중');
